sys_variable_value.value:
(function execute(inputs, outputs) {
  var responseBody = JSON.parse(inputs.response_body);  
  deployments = [];
  for (i = 0; i < responseBody.items.length; i++) {
    deployments.push(responseBody.items[i].id);
  }
  outputs.deployments = deployments;
})(inputs, outputs);

